import React from "react";
import "./About.css";

const About = () => {
    return (
        <div>
            <div className="description">
                <p>Hi, it's so nice to meet you! 
                    I'm a senior studying Cognitive Science and Human Computer Interaction at Carnegie Mellon University. 
                    My goal is to create experiences that leave happy memories with people who interact with my work. 
                    I am currently looking for full-time jobs. </p>
                <p>In my free time I create concept and splash art. 
                    I love drawing inspiration from others for my designs and artwork. 
                    I enjoy traveling around the world with my friends and family, making new DIY crafts, 
                    and competing in ballroom dance. </p>
                <p>Please feel free to reach out to me! My contact info can be found on my resume. </p>
            </div>
        </div>
    );
  };

export default About;
